import React from 'react';

const Followactivity = () => {
  return (
    <div style={styles.page}>
      <h1>กิจกรรมที่ติดตาม</h1>
      <ul>
        <li>กิจกรรม A</li>
        <li>กิจกรรม B</li>
      </ul>
    </div>
  );
};

const styles = {
  page: {
    padding: '20px',
  },
};

export default Followactivity;
